import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      // <div>
      //   <h2>Welcome to the world of covid fighters!</h2>
      //   <p>This is a website for tracking the open/closed status of restaurants, 
      //     healthcare facilities, and grocery stores during covid-19.</p>


      // </div>
      <main role="main" class="inner cover">
      <div class="opaque">
      <h1 class="cover-heading">Welcome to the World of Covid Fighters!</h1>
      <p class="lead">COVID-19 has had a tremendous impact on the world. Aside from the health crisis, 
      it has also caused the closing of many businesses, restaurants, and stores to help reduce the rate at which it spreads. 
      Additionally, with the large spikes in cases and hospitalizations coupled with losses in funds have caused some hospitals to close down. 
      With the slow reopening of these places, it can be difficult to find the new operating hours and accommodations that businesses have made in response to the spread of COVID-19.
      We decided to create an opportunity out of this situation by providing a simple means of viewing the accommodations that multiple businesses have created. 
      Our website will allow people to easily look up any restaurant, grocery store, or healthcare facility in their area and have it return information such as new hours of operation, addresses, contact information, 
      and links to the business webpage. With the situation currently changing, it can be difficult to keep up with what businesses are open and when they are open,
      and our goal is to provide a medium for people to easily find the availability of restaurants, grocery stores, and healthcare facilities near them.</p>
      </div>
      <p class="lead">
        <a href="animals.html" class="btn btn-lg btn-secondary">Learn More</a>
      </p>
    </main>

    );
  }
}

export default Home;
